message:
Nos últimos quarenta dias, Bolsonaro restringiu suas aparições públicas à cerimônias militares
No encontro com os apoiadores nesta sexta-feira 9, o presidente Jair Bolsonaro, depois de quase um 40 dias em total silêncio, discursou em público. No gramado próximo ao Palácio Alvorada, em Brasília, Bolsonaro ouviu manifestantes que demonstraram apoio ao político e entoaram gritos.
Em seu pronunciamento de aproximadamente 15 minutos, Bolsonaro pontuou algumas situações de seu governo e o momento atual do Brasil:
1- Acrescentou que decisões que passam pela sociedade são difíceis e por isso devem ser bem trabalhadas, e ainda apontou que ele, assim como seus apoiadores, luta por liberdade, inclusive de quem o critica, e finalizou afirmando que a sociedade tem o poder de mudar o futuro da nação e pedindo mais união e menos críticas.
2- Defendeu que o Brasil precisa que as leis sejam efetivamente cumpridas, além de pedir que os apoiadores respeitem a liberdade de expressão de opositores, e avaliou que o Brasil está vivendo um momento de provação, mas que é sempre tempo para acordar, ainda que seja difícil.
￼
3- Agradeceu o apoio recebido e disse nunca ter visto manifestações pedindo para um presidente ficar.
4- Declarou que acredita que as manifestações contra a falta de transparência no processo eleitoral são democráticas
5- Relembrou a facada sofrida durante a campanha presidencial de 2018 e alegou que corre risco de vida o tempo todo,
Mais trechos do pronunciamento
“Acredito em Deus e devo lealdade ao povo brasileiro”;
“Ao longo de quatro anos, resgatamos o patriotismo no Brasil. O povo voltou a acreditar que o Brasil tem jeito. O poder emana do povo. Nada está perdido. O ponto final só vem com a morte”;
“Vocês são cidadãos de verdade, e está na hora de pararem de ser tratados como outra coisa no Brasil”;
“Acredito em vocês. Vamos acreditar em nosso país e, se Deus quiser, tudo dará certo no momento oportuno”;
“Estamos lutando pela liberdade até daqueles que nos criticam”;
“Se temos críticas, erramos. Não tivemos o devido cuidado de escolher a pessoa certa. Mas as coisas vão mudando”;
“Não é ‘eu autorizo’ não. É o que eu posso fazer pela minha pátria. Não adianta jogar a responsabilidade para uma pessoa só não, eu sou como vocês”;
“Nós nunca saímos das quatro linhas da Constituição e acredito que a vitória será dessa maneira”;
“O povo voltou a admirar a sua bandeira. O povo voltou a acreditar que o Brasil tem jeito. Não é fácil você enfrentar todo o sistema. A missão de cada um de nós não é criticar, é unir”;
 
“Tenho certeza, entre as minhas funções garantidas pela Constituição, é ser o Chefe Supremo das Forças Armadas”;
“As Forças Armadas, tenho certeza, estão unidas. As Forças Armadas devem, assim como eu, lealdade ao nosso povo, respeito à Constituição e são um dos grandes responsáveis pela nossa liberdade”;
​Nas redes sociais, apoiadores do parlamentar se mostravam apreensivos com seu silêncio, ainda mais pelo fato de estarem realizando diversos atos e manifestações questionando o resultado das urnas.

